import React, { useEffect } from "react";
import { useLocation } from "react-router";

function useQuery(){
    return new URLSearchParams(useLocation().search);
}

export default function Assitir(props){

    const query = useQuery();

    useEffect(()=>{
        console.log(query.get("video"))
    })

    return (
        <div className="page">
            <h1>Youtube Video</h1>
            {query.get('v')}
        </div>
    )
}
